    function updateStateHolder(address holder) public {
        if (!isReflectionExempt[holder]) {
            if (isHolder(holder)) {
                if (_isHolder[holder] == false) {
                    _isHolder[holder] = true;
                    _holdingTime[holder] = block.timestamp;
