                        holderAddresses[holderAddresses.length - 1]
                    ] = _keyIndex[holder];
                    holderAddresses[_keyIndex[holder]] = holderAddresses[
                        holderAddresses.length - 1
                    ];
                    holderAddresses.pop();
                }
            }
        }
    }
